I’ve been diagnosed diabetes for 7 years now and honestly my life changed because of it, not in the negative way tho. I was really upset in the beginning, felt like my life has no purpose at all. Didn’t wanna do anything, just blame everyone for everything. But I changed my mindset soon I started working out. When I begin to see my improvement, It gives me a sense of achievement and confidence to stay motivated everyday! Now here I am, kicking ass with diabetes🔥 The journey still goes on. Follow me up for more information about diabetes and how to get stronger as a diabetic 🙏🏼

