我在16歲的時候發現了自己有糖尿病， 當時其實對我打擊十分大讓我覺得自己的人生好像毀了，有很多的事情都沒有辦法去做，所以我開始變得消極、怨天尤人。直到我開始健身，透過健身的過程我看到自己體態上的進步，讓我十分有成就感也為我帶來了自信，消極的想法也漸漸消失開始期待每天健身的那兩個小時。透過健身我在心智上以及體態上都進步了不少， 而我下一步的目標是希望幫助更多人了解糖尿病的知識以及如何調整飲食來有效地控止血糖在標準範圍並同時間增肌或減脂🔥 在以後的貼文當中我會分享更多此類的知識，請多多關注！

(各位記得口罩還是要戴喔）

